import { useState, useEffect } from "react"

import "./BookingForm"

export const Requests = () => { 

    const [requests, setRequest] = useState([])

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests`)
                .then(response => response.json())
                .then((requestInfo) => {
                    setRequest(requestInfo)
                })
        }, []
    )

    return ( 
        <>
        <h2> Requests </h2>
        {requests.map((request) => { 
            <div>{request.id}</div>
        })}

        </>
    )
}
